import React, { Component } from 'react'
import Test7Sub from './Test7Sub'

export default class Test7 extends Component {
    render() {
        return (
            <div>
                <h1>Test7.js메인</h1>
                <hr/>
            <Test7Sub
           
                    
                    title='신상명세서'
                name = '이효리'
                age={30}
                addr = '제주도'
                tel='010-7704-4040'
                color='skyblue'
                done={true}
            
                />
        </div>

        )
    }
}
